var x=0;
var isClosedTriggered=false;
var winnerIsTriggered=false;
var walawinssound = new Audio ("data:audio/mpeg;base64,");
var meronwinssound = new Audio ("data:audio/mpeg;base64,");
var opensound = new Audio ("data:audio/mpeg;base64,");
var alrtSound = new Audio ("data:audio/mpeg;base64,");

var arenaURL = 'http://localhost:8081/api/v1/broadcast/arena';
var betStatusURL = 'http://localhost:8081/api/v1/broadcast/bet-status';
var fightNumberURL = 'http://localhost:8081/api/v1/broadcast/fight-number';
var betSidesURL = 'http://localhost:8081/api/v1/broadcast/bet-sides';
