var option2URL = 'http://localhost:8081/api/v1/broadcast/option2';

var ArenaTitle = document.getElementsByClassName("hero-unit__subtitle text-primary")[0].innerText;
var BettingStatus = document.getElementsByClassName("pb-0 bettingStatus")[0].innerText;
var FightNumber = document.getElementsByClassName("hero-unit__subtitle text-default fightNoDisplay")[0].innerText;
var meronWinner = document.getElementsByClassName("card-body p-2 pb-0")[0].children[0].children[0].innerText.replace("MERON","");
var meronPayout = document.getElementsByClassName("card-body p-2 pb-0")[0].children[1].children[0].children[1].innerText.replace("PAYOUT = ","");
var walaWinner = document.getElementsByClassName("card-body p-2 pb-0")[0].children[0].children[1].innerText.replace("WALA","");
var walaPayout = document.getElementsByClassName("card-body p-2 pb-0")[0].children[1].children[1].children[1].innerText.replace("PAYOUT = ","");
var points = document.getElementsByClassName('currentPointsDisplay')[0].childNodes[1].innerText
var betMeron = document.getElementsByClassName("card-body p-2 pb-0")[0].children[2].children[0].children[0].innerText
var betWala = document.getElementsByClassName("card-body p-2 pb-0")[0].children[2].children[1].children[0].innerText
var betDraw = document.getElementsByClassName("card-body p-2 pb-0")[0].children[4].children[1].innerText

var statusTracker="OPEN";
var anouncementTracker = ""
var timeLastcall = 0
var timeGameOpen = 0

var total_bet_meron = null
var total_bet_wala = null
var lastcallToClosedGap = 0
var openTolastcallGap = 0
var draw_winner = null
var anouncement = ''

document.getElementsByClassName("hero-unit__subtitle text-primary")[0].innerText="";

// ==/UserScript==

let observer = new MutationObserver(mutationRecords => {
    // console.log(mutationRecords);
    // console.log("THE ARE CHANGES",meronWinner,walaWinner);
    var meronWinner = " ";
    var walaWinner = " ";
    sendData(option1URL,meronWinner);
    sendData(option2URL,walaWinner);
    setElements();
    // console.log("Betting Status:" + BettingStatus);
    // console.log("StatusTracker:" + statusTracker);
    // console.log("isClosedTriggered:" + isClosedTriggered);
    // console.log("walaWinner:"+walaWinner);
    // console.log("meronWinner:"+meronWinner);
    printStatusConsole();



    anouncement = ''
    var meron_winner = null
    var wala_winner = null

    try {
        anouncement = document.getElementById('announcement-holder').innerText
        meron_winner = document.querySelector("#app > div.betting-console > div.card.mb-2 > div > div:nth-child(1) > div.col.p-0.text-center.dark-right-border > h3 > small.winner-indicator.blinktext").innerText
        wala_winner = document.querySelector("#app > div.betting-console > div.card.mb-2 > div > div:nth-child(1) > div:nth-child(2) > h3 > small.winner-indicator.blinktext").innerText
    }
    catch(err) {}

    try {
        total_bet_meron = parseInt($('.row .dark-bg')[0].children[0].innerText.replaceAll(',',''))
        total_bet_wala = parseInt($('.row .dark-bg')[1].children[0].innerText.replaceAll(',',''))
    }
    catch(err) {}

    if((anouncement.includes('LAST CALL')) && anouncement.slice(0,9) != anouncementTracker) {
        anouncementTracker = anouncement.slice(0,9)
        timeLastcall = new Date().getTime()
        openTolastcallGap = (timeLastcall - timeGameOpen)/1000
        console.log('++++++++++++++++++++++++++++++++++++LASTCALL')
    }
    else if(!anouncement.includes('LAST CALL')) {
        anouncementTracker = ""
    }
    // console.log(meron_winner)
    // console.log(wala_winner)






    // printStatusConsole();

    if(BettingStatus =="CLOSED" && statusTracker!=BettingStatus && isClosedTriggered==false)
    {
        var timeClose = new Date().getTime()

        console.log('++++++++++++++++++++++++++++++++++++lastcall:',(timeClose - timeLastcall)/1000,)

        lastcallToClosedGap = (timeClose - timeLastcall)/1000
        openTolastcallGap = 0

        statusTracker=BettingStatus;
        alrtSound.play();
        isClosedTriggered=true;
        console.log("inside closed");
        printStatusConsole();
    }
    else if(BettingStatus =="OPEN" && statusTracker!=BettingStatus && isClosedTriggered==true){
        timeGameOpen = new Date().getTime()
        statusTracker=BettingStatus;
        isClosedTriggered=false;
        opensound.play();
        console.log("inside open");
        printStatusConsole();
        winnerIsTriggered=false;
        draw_winner = null

        lastcallToClosedGap = 0
    }


    if(meron_winner == "WINNER" && winnerIsTriggered==false)
    {
        winnerIsTriggered=true;
        meronwinssound.play();

        console.log("inside MERON winner");
        printStatusConsole();
    }
    else if(wala_winner == "WINNER" && winnerIsTriggered==false){
        winnerIsTriggered=true;
        walawinssound.play();
        console.log("inside WALA winner");
        printStatusConsole();
    }
    else if((wala_winner == "DRAW" && meron_winner == "DRAW") && winnerIsTriggered==false){
        winnerIsTriggered=true;
        draw_winner = "Draw"
        console.log("inside DRAW winner");
        printStatusConsole();
    }

    x=x+1;
    // console.log(x);


});

// observe everything except attributes
observer.observe(app, {
    childList: true, // observe direct children
    subtree: true, // and lower descendants too
    characterDataOldValue: true // pass old data to callback
});


function printStatusConsole(){
    console.log("Betting Status:" + BettingStatus);
    console.log("StatusTracker:" + statusTracker);
    console.log("isClosedTriggered:" + isClosedTriggered);
    console.log("walaWinner:"+walaWinner);
    console.log("meronWinner:"+meronWinner);

    var winner = 'Waiting';

    if (walaWinner == "WINNER") {
        console.log('WALA winner ==', walaWinner);
        winner = 'Wala';
    } else if (meronWinner == "WINNER") {
        console.log('MERON winner ==', meronWinner);
        winner = 'Meron';
    } else if(draw_winner == "Draw") {
        winner = 'Draw';
    }

    var gameStatus = '';

    if (BettingStatus === 'CLOSED') {
        gameStatus = 'Closed';
    } else {
        gameStatus = 'Open';
    }

    if(walaWinner == "CANCELLED" || meronWinner == "CANCELLED") {
        gameStatus = 'Cancel'
    }

    console.log('Arena Title', ArenaTitle);
    var jsonData = JSON.stringify({
        eventTitle: ArenaTitle,
        fightNumber: FightNumber,
        status: gameStatus,
        winner: winner,
        payoutMeron: meronPayout,
        payoutWala: walaPayout,
        totalBetMeron: total_bet_meron,
        totalBetWala: total_bet_wala,
        lastcallToClosedGap: lastcallToClosedGap,
        openTolastcallGap: openTolastcallGap,
        mainBalancePoints: parseFloat(points ?? '0'),
        betWala: betWala,
        betMeron: betMeron,
        betDraw: betDraw,
        anouncement: anouncement,
    });

    console.log('json =', jsonData);

    var xhr = new XMLHttpRequest();
    xhr.open("POST", "http://localhost:8081/api/v1/games", true);
    xhr.setRequestHeader('Content-Type', 'application/json');
    xhr.send(jsonData);

    winner = '';
}

function setElements(){

    BettingStatus = document.getElementsByClassName("pb-0 bettingStatus")[0].innerText;
    FightNumber = document.getElementsByClassName("hero-unit__subtitle text-default fightNoDisplay")[0].innerText;
    meronWinner = document.getElementsByClassName("card-body p-2 pb-0")[0].children[0].children[0].innerText.replace("MERON","");
    meronPayout = document.getElementsByClassName("card-body p-2 pb-0")[0].children[1].children[0].children[1].innerText.replace("PAYOUT = ","");
    walaWinner = document.getElementsByClassName("card-body p-2 pb-0")[0].children[0].children[1].innerText.replace("WALA","");
    walaPayout = document.getElementsByClassName("card-body p-2 pb-0")[0].children[1].children[1].children[1].innerText.replace("PAYOUT = ","");
    betMeron = document.getElementsByClassName("card-body p-2 pb-0")[0].children[2].children[0].children[0].innerText
    betWala = document.getElementsByClassName("card-body p-2 pb-0")[0].children[2].children[1].children[0].innerText
    betDraw = document.getElementsByClassName("card-body p-2 pb-0")[0].children[4].children[1].innerText
    points = document.getElementsByClassName('currentPointsDisplay')[0].childNodes[1].innerText

    sendData(arenaURL,ArenaTitle);
    sendData(betStatusURL,BettingStatus);
    sendData(fightNumberURL,FightNumber);
    //sendData(betSidesURL,SiteData);
    sendData(option1URL,meronWinner);
    sendData(option2URL,walaWinner);
}

